  FaAlignLeft,
  FaAngleDown,
  FaAngleUp,
  FaFileAlt,
  FaCalendarAlt,
} from "react-icons/fa";
// import Check from "@mui/icons-material/Check";
// import SettingsIcon from "@mui/icons-material/Settings";
// import GroupAddIcon from "@mui/icons-material/GroupAdd";
import { AiFillCheckCircle } from "react-icons/ai";

import {
  Box,
  Typography,
  Button,
  StepContent,
  VideoLabelIcon,
  Step,
  Stepper,
  Stack,
  StepLabel,
} from "@mui/material";

export default function Status() {
  const [activeStep, setActiveStep] = React.useState("");

  return (
    <>
      <div>
        <div>
          <div>
            <FaAlignLeft style={{ float: "left", margin: 15, fontSize: 20 }} />
            <p
              style={{
                float: "left",
                margin: 5,
                marginLeft: 0,
                marginRight: 90,
                fontSize: 24,
                fontWeight: 500,
              }}
            >
              Status
            </p>
            <FaAngleDown style={{ float: "left", margin: 15, fontSize: 20 }} />
          </div>
          <div>
            <p>Translator has accepted the job.</p>
          </div>
          <div></div>
          <div></div>
          <div></div>
          <hr style={{ width: " 90%", height: 1, margin: 15 }} />
        </div>

        <div>
          <div>
            <div>
              <FaFileAlt style={{ float: "left", margin: 15, fontSize: 20 }} />
              <p
                style={{
                  float: "left",
                  margin: 5,
                  marginLeft: 0,
                  marginRight: 90,
                  fontSize: 24,
                  fontWeight: 500,
                }}
              >
                Files
              </p>
              <FaAngleDown
                style={{ float: "left", margin: 15, fontSize: 20 }}
              />
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
